const Intro = () => {
  return (
    <div className="i">
      <div className="i-left">
        <div className="i-left-wrapper">
          <h2 className="i-intro">Hello, My name is</h2>
          <h1 i-name>Daniel Lloyd</h1>
          <div className="i-title"></div>
        </div>
      </div>

      <div className="i-right">Right</div>
    </div>
  );
};

export default Intro;
